import React from 'react';
import { useQuery, gql } from '@apollo/client';
import { useAuth } from '../utils/AuthContext';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

const GET_USER_DATA = gql`
  query GetUserData {
    user {
      id
      login
      transactions(where: {type: {_eq: "xp"}}, order_by: {createdAt: asc}) {
        amount
        createdAt
        path
      }
      progresses(order_by: {createdAt: asc}) {
        grade
        createdAt
        path
      }
    }
  }
`;

const Profile = () => {
  const { logout } = useAuth();
  const { loading, error, data } = useQuery(GET_USER_DATA);

  if (loading) return (
    <div className="min-h-screen flex items-center justify-center">
      <div className="text-2xl">Loading...</div>
    </div>
  );

  if (error) return (
    <div className="min-h-screen flex items-center justify-center">
      <div className="text-2xl text-red-600">Error loading data</div>
    </div>
  );

  const user = data?.user[0];
  if (!user) return null;

  // Process XP data for chart
  const xpData = user.transactions.map(tx => ({
    date: new Date(tx.createdAt).toLocaleDateString(),
    xp: tx.amount
  }));

  // Calculate total XP
  const totalXP = user.transactions.reduce((sum, tx) => sum + tx.amount, 0);

  // Calculate audit ratio
  const passedAudits = user.progresses.filter(p => p.grade > 0).length;
  const totalAudits = user.progresses.length;
  const auditRatio = totalAudits ? (passedAudits / totalAudits * 100).toFixed(1) : 0;

  return (
    <div className="min-h-screen bg-gray-100 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <div className="bg-white shadow rounded-lg p-6 mb-6">
          <div className="flex justify-between items-center mb-6">
            <h1 className="text-3xl font-bold text-gray-900">Profile</h1>
            <button
              onClick={logout}
              className="bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700"
            >
              Logout
            </button>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
            <div className="bg-gray-50 p-4 rounded-lg">
              <h2 className="text-xl font-semibold mb-2">User Info</h2>
              <p>Login: {user.login}</p>
              <p>ID: {user.id}</p>
            </div>
            <div className="bg-gray-50 p-4 rounded-lg">
              <h2 className="text-xl font-semibold mb-2">Total XP</h2>
              <p className="text-2xl font-bold">{totalXP.toLocaleString()}</p>
            </div>
            <div className="bg-gray-50 p-4 rounded-lg">
              <h2 className="text-xl font-semibold mb-2">Audit Success Rate</h2>
              <p className="text-2xl font-bold">{auditRatio}%</p>
              <p className="text-sm text-gray-600">({passedAudits}/{totalAudits} audits passed)</p>
            </div>
          </div>

          <div className="bg-gray-50 p-4 rounded-lg">
            <h2 className="text-xl font-semibold mb-4">XP Progress Over Time</h2>
            <div className="w-full overflow-x-auto">
              <LineChart width={800} height={400} data={xpData}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="date" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="xp" stroke="#4f46e5" />
              </LineChart>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
